const sampleNames = [ 'Sarah', 'Josh', 'Martinez', 'Sarah', 'Michelle', 'Michelle', 'Josh', 'Sarah' ]

 const objectNames = sampleNames.reduce(
   function(accumulator, currentName) {
     if (accumulator[currentName] === undefined) {
       accumulator[currentName] = 1
     } else {
       accumulator[currentName]++
     }
   },
   {}
 )

 // We're expecting { Sarah: 3, Josh: 2, Martinez: 1, Michelle: 2 }
 // But instead we get an error: "Cannot read property 'Josh' of undefined"
 console.log(objectNames)